import React from 'react';
import { Container, FormContainer, Title, Input} from '../styles/LoginStyles';

export default function Login() {
    return (
        <Container>
            <FormContainer>
                <Title>Login</Title>
                <Input
                    type='email'
                />
                <Input
                    type='email'
                    placeholder='Enter your email'
                />
            </FormContainer>
        </Container>
    );
}
